import React from 'react';

class UserPage extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        if (this.props.users.length === 0) {
            this.props.setUsers([
                {
                    id: 1,
                    followed: false,
                    userAvatarUrl: 'data:image/jpeg;base64,',
                    fullName: 'Dmitriy',
                    status: 'I\'m a boss',
                    location: {
                        city: 'Moscow',
                        country: 'Russia'
                    }
                },
                {
                    id: 2,
                    followed: false,
                    userAvatarUrl: 'data:image/jpeg;base64,',
                    fullName: 'Alex',
                    status: 'Just do it!',
                    location: {
                        city: 'Los-Angeles',
                        country: 'USA'
                    }
                },
                {
                    id: 3,
                    followed: true,
                    userAvatarUrl: 'data:image/jpeg;base64,',
                    fullName: 'Sara',
                    status: 'You\'re next',
                    location: {
                        city: 'Munchen',
                        country: 'Germany'
                    }
                }
            ]); 
        };

        return (
            this.props.users.map((u) => <div key={u.id} >
                <span>
                    <div>
                        <img src={u.userAvatarUrl} alt="" />
                    </div>
                    {u.followed
                        ? <button onClick={() => { this.props.unFollow(u.id) }}>Unfollow</button>
                        : <button onClick={() => { this.props.follow(u.id) }}>follow</button>}
                </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div></div>
                        <div></div>
                    </span>
                </span>
            </div>)
        )
    }
}

export default UserPage